\u7528\u4E8E\u914D\u7F6E\u7F29\u653E\u6A21\u5F0F\uFF0C\u5B57\u7B26\u4E32\u7C7B\u578B\uFF0C`,paraId:4,tocIndex:1},{value:"proportional",paraId:4,tocIndex:1},{value:"\uFF0C",paraId:4,tocIndex:1},{value:"advance",paraId:4,tocIndex:1},{value:"\uFF0C",paraId:4,tocIndex:1},{value:"stretch",paraId:4,tocIndex:1},{value:"\uFF0C",paraId:4,tocIndex:1},{value:"scroll",paraId:4,tocIndex:1},{value:"\u56DB\u79CD\u3002\u9ED8\u8BA4\u4E3A",paraId:4,tocIndex:1},{value:"advance",paraId:4,tocIndex:1},{value:"\u6A21\u5F0F",paraId:4,tocIndex:1},{value:"width",paraId:5,tocIndex:1},{value:`
\u7528\u4E8E\u914D\u7F6EUI\u7684\u6E32\u67D3\u5BBD\u5EA6\uFF0C\u6570\u5B57\u7C7B\u578B\uFF0C\u975E\u5FC5\u586B\uFF0C\u9ED8\u8BA4\u503C\u4E3A1920\u3002`,paraId:5,tocIndex:1},{value:"height",paraId:6,tocIndex:1},{value:`
\u7528\u4E8E\u914D\u7F6EUI\u7684\u6E32\u67D3\u9AD8\u5EA6\uFF0C\u6570\u5B57\u7C7B\u578B\uFF0C\u9ED8\u8BA4\u503C\u4E3A1080\u3002`,paraId:6,tocIndex:1},{value:"proportional",paraId:6,tocIndex:1},{value:"\u548C",paraId:6,tocIndex:1},{value:"stretch",paraId:6,tocIndex:1},{value:"\u6A21\u5F0F\u4E0B\uFF0C\u6B64\u53C2\u6570\u4E3A\u5FC5\u586B\u9879\uFF0C\u5176\u4F59\u6A21\u5F0F\u9AD8\u5EA6\u975E\u5FC5\u586B\u3002",paraId:6,tocIndex:1},{value:"loading",paraId:7,tocIndex:1},{value:`
\u7528\u4E8E\u624B\u52A8\u914D\u7F6ELoading\u7684\u72B6\u6001\uFF0C\u975E\u5FC5\u586B\u3002`,paraId:7,tocIndex:1},{value:"chartCount",paraId:8,tocIndex:1},{value:`
