`,paraId:48,tocIndex:5},{value:"Because the color table of CSS is developed based on Less, the less component needs to be installed.",paraId:49,tocIndex:6},{value:"The Less version of AyinColorV1 and V2 has been integrated in this framework and can be used directly.",paraId:50,tocIndex:6},{value:`//AyinColor V1
