`,paraId:57,tocIndex:10},{value:"The use of scale is ",paraId:59,tocIndex:10},{value:"$c.scale([color1,color2,.....colorN],num,type)",paraId:59,tocIndex:10},{value:"At least 2 color arrays are passed in, no upper limit",paraId:59,tocIndex:10},{value:"num is the number of colors that need to be obtained",paraId:59,tocIndex:10},{value:"type is the processing method, not required, the default value is ",paraId:59,tocIndex:10},{value:"lch",paraId:59,tocIndex:10},{value:", the alternative values are ",paraId:59,tocIndex:10},{value:"lch",paraId:59,tocIndex:10},{value:", ",paraId:59,tocIndex:10},{value:"hsl",paraId:59,tocIndex:10},{value:", ",paraId:59,tocIndex:10},{value:"lab",paraId:59,tocIndex:10},{value:", ",paraId:59,tocIndex:10},{value:"lrgb",paraId:59,tocIndex:10},{value:"Less provides the following processing functions:",paraId:60,tocIndex:10},{value:"fade",paraId:61,tocIndex:10},{value:" transparent",paraId:61,tocIndex:10},{value:"fadein",paraId:61,tocIndex:10},{value:" increases transparency",paraId:61,tocIndex:10},{value:"fadeout",paraId:61,tocIndex:10},{value:" reduces transparency",paraId:61,tocIndex:10},{value:"lighten",paraId:61,tocIndex:10},{value:" lightness",paraId:61,tocIndex:10},{value:"darken",paraId:61,tocIndex:10},{value:" darkens",paraId:61,tocIndex:10},{value:"spin",paraId:61,tocIndex:10},{value:" Hue",paraId:61,tocIndex:10},{value:"saturate",paraId:61,tocIndex:10},{value:" Saturation+",paraId:61,tocIndex:10},{value:"desaturate",paraId:61,tocIndex:10},{value:" Saturation-",paraId:61,tocIndex:10},{value:"tint",paraId:61,tocIndex:10},{value:" mixed with white to reduce color scale",paraId:61,tocIndex:10},{value:"shade",paraId:61,tocIndex:10},{value:" mixed with black to reduce color scale",paraId:61,tocIndex:10},{value:"greyscale",paraId:61,tocIndex:10},{value:" loss of saturation",paraId:61,tocIndex:10},{value:"contrast",paraId:61,tocIndex:10},{value:" Contrast",paraId:61,tocIndex:10},{value:"mix",paraId:61,tocIndex:10},{value:" mixes two colors",paraId:61,tocIndex:10},{value:"Commonly used are nothing more than fade, lighten, darken, etc. For other usage methods and detailed introductions, please refer to the color operation section in the LESS document",paraId:62,tocIndex:10},{value:"The JS and CSS versions of AyinColorV1 and V2 are open source",paraId:63,tocIndex:11},{value:", and can be used in any project at will (the declaration information in the package needs to be preserved).",paraId:63,tocIndex:11},{value:"npm address is as follows ",paraId:64,tocIndex:11},{value:"AyinColor",paraId:64,tocIndex:11},{value:"Its internal file list is as follows:",paraId:65,tocIndex:11},{value:"ayin-color.less (V1 for CSS version)",paraId:66,tocIndex:11},{value:"ayin-color-expand.less (V2 for CSS version)",paraId:66,tocIndex:11},{value:"ayin-color.js (for JS version)",paraId:66,tocIndex:11},{value:"ayin-color.json (the corresponding static color value of the JS version)",paraId:66,tocIndex:11},{value:"index.js (entry file)",paraId:66,tocIndex:11},{value:`//npm installation, recommend cnpm or pnpm
