`,paraId:56,tocIndex:27}],Na={},ka={title:"Icon Library",toc:"menu",filename:"docs/component/C03-IconLib.en-US.md",nav:"Component",group:"three parties",order:3,description:"The icon library on the market today is very rich and diverse, and its usage is also very different."},Ha=[{id:"introduction",depth:2,title:"Introduction"},{id:"how-to-use",depth:2,title:"How to use"},{id:"css-call-demo",depth:6,title:"CSS call demo:"},{id:"pros-and-cons",depth:2,title:"Pros and Cons"},{id:"the-way-css-is-called",depth:4,title:"The way CSS is called"},{id:"svg-injection",depth:4,title:"SVG injection"}],za=[{value:"The icon library on the market today is very rich and diverse, and its usage is also very different.",paraId:0,tocIndex:0},{value:"The types of icons are as follows:",paraId:1,tocIndex:0},{value:"Bitmap icons - common jpg, png, gif bitmap icons",paraId:2,tocIndex:0},{value:"SVG Icons - Vector Icons",paraId:2,tocIndex:0},{value:"Character icons - Font icons",paraId:2,tocIndex:0},{value:"Common ways to use icon libraries are as follows:",paraId:3,tocIndex:0},{value:"Import of SVG graphics - a single icon in SVG format, imported into the project through SVG injection or mask",paraId:4,tocIndex:0},{value:"Introduction of character icons - calling character icons by referring to pre-defined class names",paraId:4,tocIndex:0},{value:"iconify import (json) - This component can import the json icon set.",paraId:4,tocIndex:0},{value:"First of all, the author has not used iconify's icon import method for the time being, and is not sure about its characteristics, but looking at the size of the icon json file, I think it is a bit outrageous, such as [carbon icon library](",paraId:5,tocIndex:0},{value:"https://www.npmjs.com/",paraId:5,tocIndex:0},{value:" package/@iconify-json/carbon) has about 2000 icons, and its json file size is about 900kb.",paraId:5,tocIndex:0},{value:"And when these icons are compressed into woff2 font files, their volume is only 157kb, plus the CSS file for calling characters, the total volume is only about 240kb.",paraId:6,tocIndex:0},{value:"This is just a small icon library, with a library of tens of thousands of icons, such as ",paraId:7,tocIndex:0},{value:"Google Material Icons",paraId:7,tocIndex:0},{value:", its json file size reaches 4.31MB , and after being compressed into a woff2 file, it is only 448kb, plus the CSS reference file, its volume is only 1MB.",paraId:7,tocIndex:0},{value:"Therefore, if you refer to a complete set of icon libraries, in terms of file size, the method of character icons is recommended. The character icon library usually has a variety of font formats built in, you only need to keep woff2, which is a highly compressed font format, compatible with all major browsers.",paraId:8,tocIndex:0},{value:"This framework adopts the method of ",paraId:9,tocIndex:0},{value:"SVG icon single introduction + character icon",paraId:9,tocIndex:0},{value:"In its public development source code, the Carbon icon library is integrated.",paraId:10,tocIndex:0},{value:"FontAwesome5 Pro version (commercial authorization has been obtained) is integrated in the development package authorized by the author.",paraId:11,tocIndex:0},{value:"There are three main ways to use icons",paraId:12,tocIndex:1},{value:"CSS call",paraId:13,tocIndex:1},{value:"SVG injection",paraId:13,tocIndex:1},{value:"SVG Mask",paraId:13,tocIndex:1},{value:`//FontAwesome5pro four different styles of the same icon
